$(function () {

    $(".header-logo").on({
        mouseenter: function () {
            $(".header-logo").find('path').css('transform', 'scaleY(0)');

            $(".header-logo").find('path').each(function (index, e) {
                setTimeout(function () {
                    $(e).css('transition', 'all .2s ease-in-out');
                    $(e).css('transform', 'scaleY(.9)');
                }, (index +1) * 100)
            })

        },
        mouseleave: function () {
            $(".header-logo").find('path').each(function (e) {
                $(this).css('transform', 'scaleY(1)');
            })
        }
    });
    $('.header-navbar').click(function () {
        $('body').addClass('fixed');
        $('.header-menu').addClass('open');
    })
    $('.header-menu__close').click(function () {
        $('body').removeClass('fixed');
        $('.header-menu').removeClass('open');
    })
})







