function theRotator() {
    $('.main-slider figure').css({opacity: 0.0});

    $('.main-slider figure:first').addClass('show').css({opacity: 1.0});
    setInterval('rotate()',7000);
}

function rotate() {
    var current = ($('.main-slider figure.show')?  $('.main-slider figure.show') : $('.main-slider figure:first'));

    var next = ((current.next().length) ? ((current.next().hasClass('show')) ? $('.main-slider figure:first') :current.next()) : $('.main-slider figure:first'));

    next.css({opacity: 0.0}).addClass('show').animate({opacity: 1.0}, 1000);
    current.animate({opacity: 0.0}, 1000).removeClass('show');
};

$(document).ready(function() {
    theRotator();
});
